configuration.jsScript:
function a() {
     const cd =  new Date();
     const ch = cd.getHours();
     const cm = cd.getMinutes();
     const tm = ch* 60 + cm;
     const value = Math.sin(tm * (Math.PI/180));
     const sv = (value+10)*50
    return sv.toFixed(2);
}

var msg = { energyConsumption: a()};
var msgType = "POST_TELEMETRY_REQUEST";

return { msg: msg, msgType: msgType };

